import React from "react";
import { Link } from "react-router-dom";
import styled from 'styled-components'

const Navbar = () => {
  return (
    <NavWrapper>
      <NavLink>
        <Link to={"/"} className="navbar-brand ml-5">
          Home
        </Link>
        </NavLink>
        <NavLink>
        <Link to={"/appt"} className="navbar-brand ml-5">
          Appointments
        </Link>

        </NavLink>
    </NavWrapper>
  );
};

export default Navbar;

const NavWrapper = styled.div `
    width: 100%;
    height: 50px;
    background: white;
    color: linear-gradient(200.42deg, #ff8570 13.57%, #f9504a 98.35%);
`

const NavLink = styled.div `
    display: inline-block;
    margin: 10px;
`
